import { useEffect, useState } from "react";
import Card from "src/Components/UI/Card/Card";
import { CRow, CCol } from "@coreui/react";
const UserDetail = () => {
  const [data, setData] = useState({
    data: "",
    changed: true,
  });
  useEffect(() => {
     
  }, [data.changed])
  return (
    <>
      <CRow>
        <CCol md={6} sm={12}>
          <Card color="primary" header="Personal Information">
            fsdf
          </Card>
        </CCol>
        <CCol md={6} sm={12}>
          <Card color="primary" header="Contact Information">
            fsdf
          </Card>
        </CCol>
      </CRow>
      <CRow>
        <CCol md={6} sm={12}>
          <Card color="primary" header="Job Information">
            fsdf
          </Card>
        </CCol>
        <CCol md={6} sm={12}>
          <Card color="primary" header="About Yourself">
            fsdf
          </Card>
        </CCol>
      </CRow>
    </>
  );
};
export default UserDetail;
